sys_variable_value.value:
(function executeAction(inputs, outputs) {
    // Pegando o GlideRecord do Scheduled Import
    var gr = new GlideRecord('sys_trigger'); 
    if (gr.get(inputs.starting)) { 
        // Calcula data atual + 30 segundos
        var now = new GlideDateTime();
        now.addSeconds(30);
        
        // Atualiza o campo Starting
        gr.starting = now;
        gr.update();
    }
})(inputs, outputs);

